PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "__EFMigrationsLock" (
    "Id" INTEGER NOT NULL CONSTRAINT "PK___EFMigrationsLock" PRIMARY KEY,
    "Timestamp" TEXT NOT NULL
);
CREATE TABLE IF NOT EXISTS "__EFMigrationsHistory" (
    "MigrationId" TEXT NOT NULL CONSTRAINT "PK___EFMigrationsHistory" PRIMARY KEY,
    "ProductVersion" TEXT NOT NULL
);
CREATE TABLE IF NOT EXISTS "Brands" (
    "Id" INTEGER NOT NULL CONSTRAINT "PK_Brands" PRIMARY KEY AUTOINCREMENT,
    "Name" TEXT NOT NULL,
    "Slug" TEXT NOT NULL,
    "LogoUrl" TEXT NOT NULL,
    "Description" TEXT NULL,
    "Origin" TEXT NULL,
    "IsActive" INTEGER NOT NULL,
    "CreatedAt" TEXT NOT NULL DEFAULT (datetime('now'))
, "IndexShow" INTEGER NULL);
CREATE TABLE IF NOT EXISTS "Categories" (
    "Id" INTEGER NOT NULL CONSTRAINT "PK_Categories" PRIMARY KEY AUTOINCREMENT,
    "Name" TEXT NOT NULL,
    "Slug" TEXT NOT NULL,
    "ParentId" INTEGER NULL,
    "IsActive" INTEGER NOT NULL,
    "CreatedAt" TEXT NOT NULL DEFAULT (datetime('now'))
, "Image" TEXT NOT NULL DEFAULT '', "IndexShow" INTEGER NULL);
CREATE TABLE IF NOT EXISTS "News" (
    "Id" INTEGER NOT NULL CONSTRAINT "PK_News" PRIMARY KEY AUTOINCREMENT,
    "Title" TEXT NOT NULL,
    "Slug" TEXT NOT NULL,
    "Content" TEXT NOT NULL,
    "Image" TEXT NOT NULL,
    "IsActive" INTEGER NOT NULL,
    "CreatedAt" TEXT NOT NULL DEFAULT (datetime('now'))
);
CREATE TABLE IF NOT EXISTS "ProductSpecs" (
    "Id" INTEGER NOT NULL CONSTRAINT "PK_ProductSpecs" PRIMARY KEY AUTOINCREMENT,
    "ProductId" INTEGER NOT NULL,
    "SpecName" TEXT NOT NULL,
    "SpecValue" TEXT NOT NULL,
    "CreatedAt" TEXT NOT NULL DEFAULT (datetime('now')),
    CONSTRAINT "FK_ProductSpecs_Products_ProductId" FOREIGN KEY ("ProductId") REFERENCES "Products" ("Id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "BrandCategories" (
    "Id" INTEGER NOT NULL CONSTRAINT "PK_BrandCategories" PRIMARY KEY AUTOINCREMENT,
    "BrandId" INTEGER NOT NULL,
    "CategoryId" INTEGER NOT NULL,
    CONSTRAINT "FK_BrandCategories_Brands_BrandId" FOREIGN KEY ("BrandId") REFERENCES "Brands" ("Id") ON DELETE CASCADE,
    CONSTRAINT "FK_BrandCategories_Categories_CategoryId" FOREIGN KEY ("CategoryId") REFERENCES "Categories" ("Id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "ProductImages" (
    "Id" INTEGER NOT NULL CONSTRAINT "PK_ProductImages" PRIMARY KEY AUTOINCREMENT,
    "ImageUrl" TEXT NOT NULL,
    "AltText" TEXT NULL,
    "SortOrder" INTEGER NOT NULL,
    "ProductId" INTEGER NOT NULL,
    CONSTRAINT "FK_ProductImages_Products_ProductId" FOREIGN KEY ("ProductId") REFERENCES "Products" ("Id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "AttributeDefinitions" (
    "Id" INTEGER NOT NULL CONSTRAINT "PK_AttributeDefinitions" PRIMARY KEY AUTOINCREMENT,
    "CategoryId" INTEGER NOT NULL,
    "DataType" TEXT NOT NULL,
    "DisplayName" TEXT NOT NULL,
    "DisplayOrder" INTEGER NOT NULL,
    "Name" TEXT NOT NULL,
    CONSTRAINT "FK_AttributeDefinitions_Categories_CategoryId" FOREIGN KEY ("CategoryId") REFERENCES "Categories" ("Id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "AttributeOptions" (
    "Id" INTEGER NOT NULL CONSTRAINT "PK_AttributeOptions" PRIMARY KEY AUTOINCREMENT,
    "AttributeDefinitionId" INTEGER NOT NULL,
    "DisplayOrder" INTEGER NOT NULL,
    "Label" TEXT NOT NULL,
    "ValueKey" TEXT NOT NULL,
    CONSTRAINT "FK_AttributeOptions_AttributeDefinitions_AttributeDefinitionId" FOREIGN KEY ("AttributeDefinitionId") REFERENCES "AttributeDefinitions" ("Id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "ProductAttributeOptions" (
    "Id" INTEGER NOT NULL CONSTRAINT "PK_ProductAttributeOptions" PRIMARY KEY AUTOINCREMENT,
    "AttributeOptionId" INTEGER NOT NULL,
    "ProductId" INTEGER NOT NULL,
    CONSTRAINT "FK_ProductAttributeOptions_AttributeOptions_AttributeOptionId" FOREIGN KEY ("AttributeOptionId") REFERENCES "AttributeOptions" ("Id") ON DELETE CASCADE,
    CONSTRAINT "FK_ProductAttributeOptions_Products_ProductId" FOREIGN KEY ("ProductId") REFERENCES "Products" ("Id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "ProductAttributeValues" (
    "Id" INTEGER NOT NULL CONSTRAINT "PK_ProductAttributeValues" PRIMARY KEY AUTOINCREMENT,
    "AttributeDefinitionId" INTEGER NOT NULL,
    "DisplayOrder" INTEGER NULL,
    "ProductId" INTEGER NOT NULL,
    "ValueString" TEXT NOT NULL,
    CONSTRAINT "FK_ProductAttributeValues_AttributeDefinitions_AttributeDefinitionId" FOREIGN KEY ("AttributeDefinitionId") REFERENCES "AttributeDefinitions" ("Id") ON DELETE CASCADE,
    CONSTRAINT "FK_ProductAttributeValues_Products_ProductId" FOREIGN KEY ("ProductId") REFERENCES "Products" ("Id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "Warranties" (
    "Id" INTEGER NOT NULL CONSTRAINT "PK_Warranties" PRIMARY KEY AUTOINCREMENT,
    "CreatedAt" TEXT NOT NULL,
    "Description" TEXT NULL,
    "IndexShow" INTEGER NULL,
    "IsActive" INTEGER NOT NULL,
    "Name" TEXT NOT NULL,
    "PeriodMonths" INTEGER NOT NULL,
    "UpdatedAt" TEXT NOT NULL
);
CREATE TABLE IF NOT EXISTS "Products" (
    "Id" INTEGER NOT NULL CONSTRAINT "PK_Products" PRIMARY KEY AUTOINCREMENT,
    "BrandId" INTEGER NULL,
    "CategoryId" INTEGER NULL,
    "Code" TEXT NOT NULL,
    "CreatedAt" TEXT NOT NULL DEFAULT (datetime('now')),
    "Description" TEXT NULL,
    "Detail" TEXT NOT NULL,
    "DiscountPercent" INTEGER NULL,
    "DiscountPrice" REAL NULL,
    "Gallery" TEXT NOT NULL,
    "Image" TEXT NOT NULL,
    "IsActive" INTEGER NOT NULL,
    "Name" TEXT NOT NULL,
    "Price" TEXT NOT NULL,
    "Slug" TEXT NOT NULL,
    "WarrantyId" INTEGER NULL,
    CONSTRAINT "FK_Products_Brands_BrandId" FOREIGN KEY ("BrandId") REFERENCES "Brands" ("Id") ON DELETE RESTRICT,
    CONSTRAINT "FK_Products_Categories_CategoryId" FOREIGN KEY ("CategoryId") REFERENCES "Categories" ("Id") ON DELETE RESTRICT,
    CONSTRAINT "FK_Products_Warranties_WarrantyId" FOREIGN KEY ("WarrantyId") REFERENCES "Warranties" ("Id") ON DELETE SET NULL
);
CREATE TRIGGER update_discount_percent_insert
AFTER INSERT ON Products
FOR EACH ROW
WHEN NEW.Price > 0
BEGIN
    UPDATE Products
    SET DiscountPercent = CAST(((NEW.Price - COALESCE(NEW.DiscountPrice, NEW.Price)) * 100.0 / NEW.Price) AS INTEGER)
    WHERE Id = NEW.Id;
END;
CREATE TRIGGER update_discount_percent_update
AFTER UPDATE OF Price, DiscountPrice ON Products
FOR EACH ROW
WHEN NEW.Price > 0
BEGIN
    UPDATE Products
    SET DiscountPercent = CAST(((NEW.Price - COALESCE(NEW.DiscountPrice, NEW.Price)) * 100.0 / NEW.Price) AS INTEGER)
    WHERE Id = NEW.Id;
END;
CREATE INDEX "IX_ProductSpecs_ProductId" ON "ProductSpecs" ("ProductId");
CREATE UNIQUE INDEX "IX_BrandCategories_BrandId_CategoryId" ON "BrandCategories" ("BrandId", "CategoryId");
CREATE INDEX "IX_BrandCategories_CategoryId" ON "BrandCategories" ("CategoryId");
CREATE INDEX "IX_ProductImages_ProductId" ON "ProductImages" ("ProductId");
CREATE INDEX "IX_AttributeDefinitions_CategoryId" ON "AttributeDefinitions" ("CategoryId");
CREATE INDEX "IX_AttributeOptions_AttributeDefinitionId" ON "AttributeOptions" ("AttributeDefinitionId");
CREATE INDEX "IX_ProductAttributeOptions_AttributeOptionId" ON "ProductAttributeOptions" ("AttributeOptionId");
CREATE INDEX "IX_ProductAttributeValues_AttributeDefinitionId" ON "ProductAttributeValues" ("AttributeDefinitionId");
CREATE INDEX "IX_ProductAttributeValues_ProductId" ON "ProductAttributeValues" ("ProductId");
CREATE UNIQUE INDEX "IX_ProductAttributeOptions_ProductId_AttributeOptionId" ON "ProductAttributeOptions" ("ProductId", "AttributeOptionId");
CREATE INDEX "IX_Products_BrandId" ON "Products" ("BrandId");
CREATE INDEX "IX_Products_CategoryId" ON "Products" ("CategoryId");
CREATE UNIQUE INDEX "IX_Products_Code" ON "Products" ("Code");
CREATE INDEX "IX_Products_WarrantyId" ON "Products" ("WarrantyId");
COMMIT;
